'''111 Squadron''' is a territorial reserve squadron of the [[South African Air Force]]. The squadron is primarily involved in [[Very Important Person|VIP]] transport and [[reconnaissance]] flights in the [[Gauteng]] area. The squadron is headquartered at [[AFB Waterkloof]].<ref>{{cite web|title=South African Air Force (unofficial)|url=http://www.saairforce.co.za/recruitment/reservesqn|work=Air Force Reserve Squadrons}}</ref>
